INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (0, 100, 0, "", "", 1, 8, 0, 40000, 36, 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (0, 150, 1, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", "ぺコリーヌ", 1, 8, 107501, 40001, 37, 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (0, 150, 1, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", "コッコロ", 2, 8, 107601, 40001, 38, 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (0, 150, 1, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", "キャル", 3, 8, 107801, 40001, 39, 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (0, 150, 1, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", "スズメ", 4, 8, 107701, 40001, 40, 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (0, 150, 1, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", "タマキ", 5, 8, 107901, 40001, 41, 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (0, 150, 2, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", "ぺコリーヌ", 6, 8, 107501, 40001, 42, 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (0, 150, 2, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", "コッコロ", 7, 8, 107601, 40001, 43, 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (0, 150, 2, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", "キャル", 8, 8, 107801, 40001, 44, 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (0, 150, 2, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", "スズメ", 9, 8, 107701, 40001, 45, 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (0, 150, 2, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", "タマキ", 10, 8, 107901, 40001, 46, 91002);
