INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (0, 1, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", "リリ", 1, 2, 125801, 40011, 321, 24001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (0, 1, 1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", "クリア", 2, 2, 126001, 40011, 322, 24001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (0, 1, 1, "んーと。\nこれ、あげる。\nはい", "プレシア", 3, 2, 126101, 40011, 323, 24001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (0, 1, 2, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", "リリ", 4, 2, 125801, 40011, 324, 24001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (0, 1, 2, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", "クリア", 5, 2, 126001, 40011, 325, 24001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (0, 1, 2, "お兄。\nきてくれて、うれしい", "プレシア", 6, 2, 126101, 40011, 326, 24001);
